var downloadCallToActionCss="\n<h4>Information</h4>\n<h5>Container</h5>\n<code>\n<pre>\n/* Container */\n.call-to-action {\n  height: auto;\n  border-top: none;\n  background: none;\n  padding: 32px;\n  border-top: 4px solid #d8d8d8;\n  background: #ebebeb;\n  font-family: \"Open Sans\", sans-serif;\n  font-size: 1rem;\n  letter-spacing: 0.0125rem;\n  line-height: 1.78;\n  text-align: left;\n}\n</pre>\n</code>\n    \n<h5>Text</h5>\n<code>\n<pre>\n/* Text */\n.call-to-action h2 {\n  padding: 0 0 32px 0;\n  margin: 0;\n  font-weight: 600;\n  font-style: normal;\n  line-height: 1.25;\n  font-size: 32px;\n}\n.call-to-action p {\n  line-height: 32px;\n  font-size: 16px;\n  padding: 0 0 32px 0;\n  margin: 0;\n  letter-spacing: 0.0125rem;\n  color: #333;\n  display: inline-block;\n}\n</pre>\n</code>\n    \n<h5>List</h5>\n<code>\n<pre>\n/* List */\n.call-to-action ul {\n  padding: 0 0 0 16px;\n  margin: 0;\n  line-height: 1.78;\n  list-style: none;\n}\n.call-to-action ul li {\n  padding-bottom: 16px;\n  margin: 0;\n  line-height: 32px;\n  position: relative;\n}\n.call-to-action ul li:last-of-type {\n  padding-bottom: 32px;\n}\n.call-to-action ul li p {\n  padding: 0px;\n  display: inline;\n}\n.call-to-action ul li svg {\n  padding-right: 16px;\n}\n</pre>\n</code>        \n    \n<h5>Button</h5>\n<code>\n<pre>\n/* Button */\n.call-to-action .button-wrapper {\n  width: auto;\n  display: inline-block;\n  transition-property: transform, -webkit-transform;\n  transition-duration: 0.4s, 0.4s;\n  transition-timing-function: ease, ease;\n  transition-delay: 0s, 0s;\n  margin-top: 4px;\n}\n.call-to-action .button {\n  background: #4569a0 0% 0% no-repeat padding-box;\n  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px 0px;\n  border: 2px solid #254f90;\n  border-radius: 6px;\n  opacity: 1;\n  padding: 8px 32px;\n  text-align: center;\n  letter-spacing: 0;\n  color: #ffffff;\n  font-family: \"Open Sans\", sans-serif;\n  font-weight: 600;\n  font-style: normal;\n  transition: box-shadow 0.25s, -webkit-box-shadow 0.25s;\n  text-decoration: none !important;\n}\n.call-to-action .button:hover {\n  background: #254f90 0% 0% no-repeat padding-box;\n  box-shadow: rgba(0, 0, 0, 0.3) 0px 4px 8px 0px;\n  border: 2px solid #18335c;\n  border-radius: 6px;\n  opacity: 1;\n}\n.call-to-action .button-wrapper:hover {\n  transform: translateY(-0.1875rem);\n}\n</pre>\n</code>\n    \n\n<h5>Media query</h5>\n<code>\n<pre>\n/* Media query */\n@media (max-width: 576px) {\n  .call-to-action {\n    padding: 24px;\n  }\n}\n</pre>\n</code>\n\n<h4>Download card</h4>\n<h5>Containers</h5>\n<code>\n<pre>\n/* Download card*/\n/* Container */\n.download-card {\n  background: #ffffff;\n  border: none;\n  border-top: 0.25rem solid #b3c2d8;\n  padding: 0;\n  width: 100%;\n}\n.download-card:hover {\n  cursor: pointer;\n}\n.download-card-content {\n  padding: 1.5rem;\n  transition: all 0.2s ease;\n  box-sizing: border-box;\n  width: 90%;\n  text-align: left;\n  font-family: \"Open Sans\", sans-serif;\n}\n.download-card:focus .download-card-content,\n.download-card:hover .download-card-content {\n  transform: translateX(1rem);\n}\n.link-container {\n  align-items: center;\n  display: flex;\n  position: relative;\n}\n</pre>\n</code>\n    \n<h5>Text</h5>\n<code>\n<pre>\n/* Text */\n.download-card p {\n  font-size: 1rem;\n  font-weight: 600;\n  letter-spacing: normal;\n  line-height: 1.56;\n  margin-bottom: 0;\n  line-height: 32px;\n  font-size: 1rem;\n  padding: 0 0 32px 0;\n  margin: 0;\n  color: #333;\n}\n.download-card:hover .p,\n.download-card:hover .p {\n  color: #254f90;\n}\n.download-card:focus span,\n.download-card:hover span {\n  margin-left: 1rem;\n}\n</pre>\n</code>\n    \n<h5>Icon</h5>\n<code>\n<pre>\n/* Icon */\n/* Circle icon */\n.download-card .circle-icon {\n  bottom: 0;\n  display: none;\n  height: 32px;\n  left: 0;\n  margin-bottom: auto;\n  margin-right: 0;\n  margin-top: auto;\n  padding-top: inherit;\n  position: absolute;\n  top: 0;\n  transform: translateX(-0.5rem);\n  width: 32px;\n}\n.download-card .circle-icon svg {\n  fill: none;\n}\n.download-card:focus .circle-icon,\n.download-card:hover .circle-icon {\n  display: inline;\n}\n.download-card:focus .circle-icon svg,\n.download-card:hover .circle-icon svg {\n  fill: #4569a0;\n  transition: fill 0.2s ease;\n}\n/* Download icon */\n.download-icon {\n  height: 16px;\n  width: 16px;\n  display: inline-block;\n  fill: #254f90;\n  line-height: 0;\n  position: relative;\n  right: 0;\n}\n.download-card .download-icon svg {\n  fill: #4267b2;\n}\n.download-card span {\n  color: #666;\n  font-size: 0.75rem;\n  line-height: 2px;\n  margin-left: 0.5rem;\n  text-transform: uppercase;\n  letter-spacing: 0;\n  font-size: 12px;\n}\n.download-card:focus .download-icon svg,\n.download-card:hover .download-icon svg {\n  fill: #fff;\n}\n</pre>\n</code>        \n";$(".download-call-to-action-code .css-code").html(downloadCallToActionCss); //CALL OUT BOXES
