var checklistItemsCss=" \n<h4>Desktop</h4>\n<h5>Item title</h5>\n<code>\n<pre>h2{\n    color: #333333;\n    font-family: OpenSans-Semibold;\n    font-size: 26px;\n    line-height: 32px;\n    text-decoration: none;\n}\nh2:hover {\n    text-decoration: underline;\n}\n</pre>\n</code>\n    \n<h5>Sub-item title</h5>\n<code>\n<pre>h3{\n    color: #333333;\n    font-family: OpenSans-Semibold;\n    font-size: 21px;\n    line-height: 26px;\n    text-decoration: none;\n}\nh3:hover {\n    text-decoration: underline;\n}\n</pre>\n</code>\n    \n<h5>Item number</h5>\n<code>\n<pre>h2.number{\n    color: #333333;\n    font-family: OpenSans-Semibold;\n    font-size: 26px;\n    line-height: 25px;\n    text-decoration: none;\n    border-radius: 50%;\n    border: 3px solid #C7C7C7;\n    height: 48px;\n    width: 48px;\n}\nh2.number.open {\n    color: #FFFFFF;\n    background-color: #254F90;\n    border: 3px solid #254F90;\n}\nh2.number.ticked {\n    color: #FFFFFF;\n    background-color: #297E28;\n    border: 3px solid #297E28;\n}\n.tick-icon {\n    color: #FFFFFF;\n    background-position: center center;\n    background-size: 20px 16px;\n}\n</pre>\n</code>\n<h5>Item button (chevron)</h5>\n<code>\n<pre>.icon {\n    color: #254F90;\n    height: 12px;\n    width: 20px;\n}\n.icon:hover {\n    background-color: #EBEBEB;\n    background-size: 38px 38px;\n}\n.icon:active {\n    background-color: #EBEBEB;\n    background-size: 38px 38px;\n}\n</pre>\n</code>\n    \n<h5>Sub-item button (chevron)</h5>\n<code>\n<pre>.icon {\n    color: #254F90;\n    height: 12px;\n    width: 20px;\n}\n.icon:hover {\n    background-color: #FFFFFF;\n    background-size: 38px 38px;\n}\n.icon:active {\n    background-color: #FFFFFF;\n    background-size: 38px 38px;\n}\n</pre>\n</code>\n    \n<h5>Tips container</h5>\n<code>\n<pre>tips.container{\n    background-color: #EBEBEB;\n}\n</pre>\n</code>\n    \n<h5>Must Do container</h5>\n<code>\n<pre>must-do.container{\n    background-color: #E5EDF7;\n}\n</pre>\n</code>\n    \n<h5>Must Do tag</h5>\n<code>\n<pre>.must-do{\n    color: #FFFFFF;\n    background: #254F90;\n    font-family: OpenSans;\n    font-size: 13px;\n    border-radius: 20px;\n    padding: 0 10px;\n    display: inline-block;\n}\n</pre>\n</code>\n    \n<h5>Checkbox container</h5>\n<code>\n<pre>checkbox.container{\n    background-color: #BAC8DB;\n}\ncheckbox.container.checked {\n    background-color: #B7DDB7;\n}\n</pre>\n</code>\n    \n<h5>Checkbox</h5>\n<code>\n<pre>label {\n    color: #333333;\n    font-family: OpenSans;\n    font-size:16px;\n}\ncheckbox {\n    background-color: #FFFFFF;\n    border: 2px solid #254F90;\n}\ncheckbox.checked {\n    background-color: #FFFFFF;\n    border: 2px solid #297E28;\n}\n</pre>\n</code>\n \n    \n<h4>Mobile</h4>\n<h5>Item title</h5>\n<code>\n<pre>h2{\n    font-size: 20px;\n    line-height: 25px;\n}\n</pre>\n</code>\n    \n<h5>Sub-item title</h5>\n<code>\n<pre>h3{\n    font-size: 18px;\n    line-height: 22px;\n}\n</pre>\n</code>\n    \n<h5>Item number</h5>\n<code>\n<pre>h2.number{\n    font-size: 26px;\n}\n</pre>\n</code>\n    \n<h5>Item content</h5>\n<p>Text inside the items is styled with the <a href=\"/bga-design-system/foundations/typography.html\" aria-label=\"typography guidelines\">design system standard typography styles.</a></p> \n";$(".checklist-items-code .css-code").html(checklistItemsCss); //Checklist save progress
